    false,nt"url": null,nt"notes": "The Washington State Department of Health
    presents this information as a service to the public. True and correct copies of
    legal disciplinary actions taken after July 1998 are available on our Provider Credential
    Search site. These records are considered certified by the Department of Health.
    rnrnThis includes information on health care providers.rnrnPlease contact our Customer
    Service Center at 360-236-4700 for information about actions before July 1998. rnThe
    information on this site comes directly from our database and is updated daily at
    10:00 a.m.. This data is a primary source for verification of credentials and is
    extracted from the primary database at 2:00 a.m. daily.rnrnNews releases about disciplinary
    actions taken against Washington State healthcare providers, agencies or facilities
    are on the agency's Newsroom webpage.rnrnDisclaimerrnThe absence of information
    in the Provider Credential Search system doesn't imply any recommendation, endorsement
    or guarantee of competence of any healthcare professional. The presence of information
    in this system doesn't imply a provider isn't competent or qualified to practice.
    The reader is encouraged to carefully evaluate any information found in this data
